var lastAction = false;
var lastState = getState();
var timeSinceLastFail = 0;

function go() {
    timeSinceLastFail++;
    var state = getState();
    learn(lastState, state, lastAction,
        failed() ? -1000 : 1);

    var action = nextAction(state);
    if (action) jump();

    lastAction = action;
    lastState = state;

    if (failed()) {
        console.log(timeSinceLastFail);
        timeSinceLastFail = 0;
        restart();
        jump();
    }
}

interval = setInterval(go, 100);
